import React from 'react';

function Postagem({ postagem }) {
  return (
    <div className="postagem">
      <div className="autor">
        {postagem} - {postagem.Data}
      </div>
      <div className="conteudo">
        {postagem.Conteudo}
      </div>
      {postagem.Foto && (
        <img src={postagem.Foto} alt="Foto da postagem" />
      )}
    </div>
  );
}

export default Postagem;
